import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'
import MainView from '@/views/MainView.vue'
import PlanView from '@/views/MainView.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView,
    children:[
      {
        path: '/main',
        name: 'main',
        component: MainView
      },
      {
        path: '/plan',
        name: 'plan',
        component: PlanView
      },
    ]
  },

]

const router = new VueRouter({
  routes
})

export default router
